            "name": "King Kai"
        },
        {
            "id": 7,
            "image": mrsatan,
            "name": "Mr. Satan"
        },
        {
            "id": 8,
            "image": shenron,
            "name": "Shenron"
        },
        {
            "id": 9,
            "image": southkai,
            "name": " South Kai"
        }
    ];

        return(
            <div className = "imagesContainer">
                {images.map((image, i) => {
                    return <Image key ={image.id} img = {image.image} imageAlt = {image.name} hideParentsParentP = {this.props.hideParentP}/>
                })}

            </div>
        )
    }

}

export default ImagesContainer;
